import React from "react";
import { Link } from "react-router-dom";

const Home = ({ shows }) => {
  return (
    <div>
      <h1>TV Shows</h1>
      <ul>
        {shows.map((show) => (
          <li key={show.show.id}>
            <Link to={`/show/${show.show.id}`}>{show.show.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Home;
